    clickCancelButton() {
        this.cancelButton.click();
    }

    clickContinueButton() {
        this.continueButton.click();
    }

    navigateToItem(itemNumber) {
        this.cartListItems[itemNumber].itemName.click();
    }
}

export default new CheckoutStepOnePage();

